Carole Maggio

        Carole Maggio, considered &quot;the world?s foremost authority on facial exercises&quot; has devised a series of synergistic exercises which she has successfully taught to hundreds of thousands of clients world wide. In 1995, as an answer to thousands of questions regarding her techniques, she authored the best selling book, FACERCISE. This book continues to be a top selling item in bookstores worldwide. She has also produced two videos and two audio tapes to demonstrate her FACERCISE techniques.
